:::
:::


Within `dataset`, there is an array called `distribution` which contains all dataset versions, in all available formats:


::: {.cell layout-align="center"}

```{.r .cell-code}
distribution <- data_json |> 
  pull(dataset) |> 
  pluck(1) |> 
  select(distribution) |> 
  unnest(distribution)

distribution
```

::: {.cell-output .cell-output-stdout}

