# Using the API

Data is available on the API in JSON and JSON:API formats. You can also download the source CSV file directly. 

To get the entire dataset?

The default is to provide the first 1,000 rows per request. However, there is an ability to increase the limit to 5,000 rows per request. You can use pagination to retrieve the entire dataset. For example, with our Opt Out Affidavits dataset:

   1. Start with this request to get the number of rows:
      * _https://data.cms.gov/data-api/v1/dataset/9887a515-7552-4693-bf58-735c77af46d7/data/stats_

   2. Make a request for the first 5,000 rows:
      * _https://data.cms.gov/data-api/v1/dataset/9887a515-7552-4693-bf58-735c77af46d7/data?size=5000&offset=0_

   3. Make a request for the next 5,000 rows:
      * _https://data.cms.gov/data-api/v1/dataset/9887a515-7552-4693-bf58-735c77af46d7/data?size=5000&offset=5000_

   4. Continue increasing the offset until you reach the count from step 1

